PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `Bots` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `botID` VARCHAR(255) NOT NULL, `prefix` VARCHAR(255) NOT NULL, `ownerID` VARCHAR(255) NOT NULL, `shortDesc` VARCHAR(255) NOT NULL, `longDesc` VARCHAR(255) NOT NULL, `botServer` JSON, `botWebsite` JSON, `customInvite` JSON, `botTags` JSON NOT NULL DEFAULT '[]', `inTesting` TINYINT(1) NOT NULL DEFAULT 0, `isApproved` TINYINT(1) NOT NULL DEFAULT 0, `inMain` TINYINT(1) NOT NULL DEFAULT 0, `testedBy` VARCHAR(255), `submittedOn` VARCHAR(255) NOT NULL, `approvedOn` VARCHAR(255), `totalUpvotes` VARCHAR(255) NOT NULL DEFAULT '0', `guildsCount` VARCHAR(255) NOT NULL DEFAULT '0', `verifiedBot` TINYINT(1) NOT NULL DEFAULT 0, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL, UNIQUE (`botID`));
DELETE FROM sqlite_sequence;
COMMIT;
