INSERT INTO Bots VALUES(28,'711553356488769549','Саня ','432930718490951680','Крутой русский развлекательный бот с множеством полезных функций',replace('В ассортименте команд бота есть команды модерации, информативные команды, утилиты, полезности, веселости и даже небольшие мини-игры!<br>\n<h1>\nМОДЕРАЦИЯ<br>\n </h1>\nВ неë входят такие команды как мут, кик, бан, варн и даже блокировка всех каналов сервера для everyone. Но и это не весь список.<br>\n<h1>\nИНФОРМАТИВНЫЕ КОМАНДЫ<br>\n</h1>\nВ них входят такие команды как информация о сервере, пользователе, ролях, эмодзи. Можно даже посмотреть аватарку человека. И всë это сопровождается офигенным оформлением!<br>\n<h1>\nУТИЛИТЫ<br>\n</h1>\nВ этом разделе есть такие команды как вывод сообщение в вебхуке от вашего имени, выдать/посмотреть репутацию, посмотреть предупреждения, отправить предложение или жалобу на пользователя сервера.<br>\n<h1>\nПОЛЕЗНОСТИ<br>\n</h1>\nВ данном разлеле есть такие команды как узнавание погоды, напоминалка, переводчик, поиск в google и узнавание оставшегося врмени до скачиввния файла.<br>\n<h1>\nВЕСЕЛОСТИ<br>\n</h1>\nЭто самый большой раздел команд, поэтому назову функции некоторых из них: фотки котика или собачки, повторение текста за вами, рандомное число, ударить или обнять человека и другие!<br>\n<h1>\nИГРЫ<br>\n</h1>\nВ этом разделе находится всего 3 мини-игры (на данный момент другие были удалены): казино, камень-ножницы-бумага и, самое крутое, крестики-нолики! Кстати, в последнее можно сыграть с другом)<br>\n<h1>\nНАСТРОЙКИ<br>\n</h1>\nНу как можно быть хорошим ботом, не имея полезных настроек? У Сани они есть! В них можно настроить такие функции как пожелания, жалобы на пользователей, приветствия, автороли, логи и многое другое в будущем!<br>\n<i>\nВ общем, лучше самому опробовать все команды, чтобы убедиться, что он офигенный. Удачи!\n</i>','\n',char(10)),'"69TujDy"',NULL,'"https://discord.com/oauth2/authorize?client_id=711553356488769549&scope=bot&permissions=8"','["moderation","fun