INSERT INTO Bots VALUES(42,'772777637126995988','-','725731055012937809','Quantum — это новый и очень интересный бот с множеством функций.',replace('Quantum — это новый и очень интересный бот с множеством функций.\n\nВ данном боте есть все, что нужно для сервера, начиная от экономики заканчивая модерацией/логами. Quantum еще на стадии глобального обновления, которое по планам должно выйти 1 декабря, что изменит всего в бота в лучшую сторону еще больше. Мы ждем новых пользователей и рады каждому новому серверу или же довольному пользователю, а если вы что-то не поняли или же вам нужна помощь, можете смело обращаться на сервер поддержки бота.\n\nQuantum — просто, не бывает никогда!','\n',char(10)),'"8Xbj33gyVc"',NULL,'"https://discord.com/oauth2/authorize?client_id=772777637126995988&permissions=8&scope=bot"','["moderation","fun","economy","utility"]',1,1,1,'430785563755413504','1605454587293','1605454692154','0','0',0,'2020-11-15 15:36:27.293 +00:00','2020-11-15 15:38:47.065 +00:00');
INSERT INTO Bots VALUES(45,'739333817441189940','*','732643855782117559','Универсальный бот для модерации, развелчения на вашем сервере.','Бот имеет модерационные функции, такие как мут, бан, очистка сообщений. Есть система голосований, фан команды. Бот считает опыт за сообщения, просмотреть опыт можно в профиле. Имеются NSFW-команды. Префикс можно сменить. Есть профиль, но он неполный 😃. Вы можете присылать идеи отдельной командой! Все найденные баги вы можете отправить специальной командой и мы их пофиксим.',NULL,NULL,'"https://discord.com/oauth2/authorize?client_id=739333817441189940&scope=bot&permissions=8"','["moderation","fun"]',1,1,1,'430785563755413504','1605526718170','1605527113423','0','0',0,'2020-11-16 11:38:38.171 +00:00','2020-11-16 17:06:48.881 +00:00');
INSERT INTO Bots VALUES(51,'776452481076166666','.','400585555882278913','Простой Музыкальный бот который растёт и развивается.',replace('<style type="text/css">\nhtml, body,  .container {\ncolor: white;\n}\n\n.buttons {\npadding-top: 2%;\npadding-bottom: 2%;\nmargin-top: 3% !important;\nborder-radius: 90px 90px 90px 90px;\nborder: 2px solid #fff;\nbackground-color: #23272A;\ncolor: white;\ntext-align: center;\n}\n\n.jumbotron {\nborder-radius: 90px 90px 90px 90px;\nborder: 2px solid #fff;\nbackground-color: #23272A;\ncolor: white;\n} \n\n.text-muted {\nmargin-left: 6px !important;\nbackground-color: #fff;\nborder: 3px solid #fff;\nborder-radius: 90px 90px 90px 90px;\n}\n\n.card, .card-body, .bot-description {\nbackground-color: #fff;\nborder: 1px solid #fff;\nborder-radius: 20px 100px 20px 20px;\n}\n\n.text-primary strong  {\ncolor: #2cbad3\n}\n\n.input-group-text, .form-control, .card-body {\nbackground-color: #23272A;\ncolor: white;\n}\n</style>\n\n<div class=''.container''>\n<h1><strong>KerdokuMusic Bot</strong> <br> Простой Музыкальный бот который растёт и развивается. </h1>\n<p>Отзывчивые разработчики стараются наполнять бота различным функционалом и оперативно исправлять все найденные баги.</p>\n<p></p>Но стоить помнить что это просто Музыкальный Бот, если вам нужно что-то большее по типу модерации то существует <strong>KerdokuBot</strong> который потихоньку наполняется новым функционалом.</p>\n\n<code>Бота разрабатывают Grey Cat#5015 и don#4170</code>\n</div>','\n',char(10)),'"5qXgJvr"','"https://kerdoku.top/"','"https://discord.com/oauth2/authorize?client_id=776452481076166666&permissions=37087696&scope=bot"','["music"]',1,1,1,'430785563755413504','1605542306413','1605542419122','22','0',0,'2020-11-16 15:58:26.413 +00:00','2020-11-28 07:41:38.884 +00:00');
INSERT INTO Bots VALUES(52,'677176212518600714','f. и f/','407524032292847624','flasher - многофункциональный бот именно для вашего сервера!',replace('### Исходники бота в этот момент переписываются, в связи с чем новая версия бота работает с префиксом `f/`. \n#### В случае если этот префикс конфликтует с другими на вашем сервере вы можете изменить его используя `@flasher#8605 prefix guild <новыйПрефикс>`\n\nВ боте можно найти много полезных комманд, к примеру\n\n`translate` поможет вам перевести текст с одного языка на другой.\n\n<!-- Закоментировал потому что команда отключена | Хотите сменить свой дискриминатор (к примеру #0000), но у вас нету подписки Discord Nitro? Воспользуйтесь `mytag`, сменив ник на один из указаных ваш дискриминатор изменится на любой другой случайный.-->\n\n`snapshot` поможет вам увидеть веб-страницу не заходя на неё и не рискуя.\n\n`calculate` обчислит почти любой пример.\n\nУзнайте последние новости бота с помощью `dashboard`\n\nВ боте есть также своя собственная экономика и возможность настройки как префикса сервера так и **собственного префикса** с наивысшим приоритетом.\n\nЗабыли префикс? Упомянув бота вы исполняете `prefix` - команду для проверки префиксов, так что узнать его не составит труда.\n\n### В связи с техническими ограничениями площадки префикс бота не упоминается рядом с командами\n\n###### Запрос данных или их удаление, уведомления о критических багах и уязвимостей в безопасности <s>исполняеться на почтовый ящик [тут был емейл]</s> уведомляйте мне в ЛС ибо я не могу вставить сюда почту.\n\n###### Другие баги отсылайте через Github в вкладке Issues\n<style>\nbody {\nbackground: rgb(22,82,82);\nbackground: linear-gradient(90deg, rgba(22,82,82,1) 0%, rgba(57,22,75,1) 100%); \n}\n\n.botPage {\nbackground: linear-gradient(183deg, rgba(103,140,140,1) 0%, rgba(91,68,103,1) 100%); \n\n\n.botUpBtn .botPageInvite {\nbackground: rgb(42,177,174);\nbackground: linear-gradient(90deg, rgba(42,177,174,1) 0%, rgba(141,37,195,1) 100%);\n}\n</style>\n','\n',char(10)),'"hKVQTZP"','"https://github.com/tuxlabore/flasher-rewrite/"','"https://discord.com/oauth2/authorize?client_id=677176212518600714&scope=bot&permissions=8"','["fun","economy","utility"]',1,1,1,'430785563755413504','1605545723608','1605546517165','0','0',0,'2020-11-16 16:55:23.608 +00:00','2020-11-16 17:08:37.166 +00:00');
INSERT INTO Bots VALUES(53,'721771011225419778','!!','341196322113716245','Верифицированных русскоязычный бот для модерации, развлечения и игр.',replace('**!!helps - информация о командах**\n\n*Пример команд:*\n\n❯ *Разные:*\n**kiss, hug, slap, pat, meme, ball.**\n\n❯ *Информационные:*\n**avatar, serverinfo, profile(добавлены значки/бейджики), sweets(дать сладость)**\n\n❯ *Игры:*\n**knb, dice, угадай, сапёр, флаги.**\n\n❯ *Команды модерации:*\n**ban, tempmute, kick, clear**','\n',char(10)),'"wzFYJH2"',NULL,'"https://discord.com/oauth2/authorize?client_id=721771011225419778&scope=bot&permissions=2113268862%22"','["moderation","fun"]',1,1,1,'534794173258137620','1605547133739','1605547329071','53','0',0,'2020-11-16 17:18:53.740 +00:00','2020-11-30 19:55:55.860 +00:00');
INSERT INTO Bots VALUES(54,'711849314514894858','/','509987377947869194','Веселый и общительный бот. С этим ботом вам никогда не будет скучно!',replace('Введите /help для списка команд. Характеристики: * Uptime, 24/7 Умеренность-умеренность с предупреждениями, приглушениями / запретами. Пользовательские команды-простота в использовании пользовательских команд. Rem-потому что все любят Ramen Он часто обновляется с новыми функциями и усовершенствованиями. Если есть какие-либо функции, которые вы хотели бы видеть.\n\nПри обнаружении ошибок в боте вы всегда можете обратится за помощью в нашу Тех. Поддержку на официальном сервере!\n\nMegumin, девочка с хорошим характером. Может оповещать о входах/выходах пользователей с вашего сервера.\n\nСистема Anti-Link защитит от рекламы на вашем сервере. Имеются команды модерации.','\n',char(10)),'"e75sY9jcKE"',NULL,'"https://discord.com/api/oauth2/authorize?client_id=711849314514894858&permissions=8&scope=bot"','["moderation","fun","economy"]',1,1,1,'430785563755413504','1605549960793','1605550362956','0','0',0,'2020-11-16 18:06:00.794 +00:00','2020-11-17 07:56:12.644 +00:00');
INSERT INTO Bots VALUES(63,'628264931783081984','!','385399635948339200','Комочек счастья для вашего сервера!',replace('Что я умею?\n\n**Система аудита**: Husmut способен следить за удалением и изменением сообщений и многим другим!\n\n**Сообщество**: Любите ваше сообщество! Взаимодействуйте с ним с помощью системы уровней, экономики и магазином ролей!\n\n**Привет, пока!**: Настройте собственные приветствия для участников: в ЛС или в отдельный канал на сервере!\n\n**Кастомизация**: Меняйте префикс бота, его язык и остальное как захотите!','\n',char(10)),'"xtF37JH"',NULL,'"https://discord.com/oauth2/authorize?client_id=628264931783081984&permissions=268823640&scope=bot"','["moderation","fun","economy","leveling"]',1,1,1,'430785563755413504','1605764123069','1605772128729','12','0',0,'2020-11-19 05:35:23.070 +00:00','2020-11-30 17:40:43.914 +00:00');
INSERT INTO Bots VALUES(64,'772527172006445067','-','634060873731670018','Пушистый рп бот для вашего сервера!',replace('Здравствуйте я ARKRAFTER#7974!\nЕсть несколько особенностей моего бота\n                         <h4> почему стоит добавить CatBot:</h4>\n<h8> - есть RolePlay комманди.</h8><br/>\n<h8>- отзивчивий разработчик</h8>\n<h8> <br/> - отзивчивая поддержка<h8>\n<br/>\n<p> если нужна помощ можете смело обращаться ко мне в лс и на сервер поддержки</p>\n</html>','\n',char(10)),'"MuRyH7RZAX"',NULL,'"https://discord.com/oauth2/authorize?client_id=772527172006445067&permissions=8&scope=bot"','["moderation","fun","utility"]',1,1,1,'375274737103798282','1605780442690','1605780895096','7','0',0,'2020-11-19 10:07:22.691 +00:00','2020-11-30 19:56:18.665 +00:00');
INSERT INTO Bots VALUES(65,'773555742758273025','!','464335210134110239','Крэки - бот для добавления на сервер экономики и фановых фишек',replace('<h1 style="text-align: center;">Привет!</h1>\n<p style="text-align: center;"><strong>Крэки - удобный и простой в использовании бот, который добавит к вам на сервер кланы, экономику и много приколяшек!</strong></p>\n<p style="text-align: center;"><strong>------------------------Cracky----------------------------</strong></p>\n<p style="text-align: center;"><strong>В командах крэки ты найдешь:</strong></p>\n<p style="text-align: center;"><strong>Модерацию</strong></p>\n<p style="text-align: center;"><strong>Экономику</strong></p>\n<p style="text-align: center;"><strong>Систему кланов (Beta)</strong></p>\n<p style="text-align: center;"><strong>Создание мемов</strong></p>\n<p style="text-align: center;"><strong>Узнать кто предатель?!</strong></p>\n<p style="text-align: center;"><strong>Возможность изменить префикс</strong></p>\n<p style="text-align: center;"><strong>РолеПлей команды</strong><strong></strong></p>\n<p style="text-align: center;"><strong></strong></p>\n<p style="text-align: center;"><strong>------------------------Планы----------------------------</strong></p>\n<p style="text-align: center;"><strong>В скором времени у бота появятся свадьбы)</strong></p>\n<p style="text-align: center;"><strong>Обновится система кланов и экономики</strong></p>\n<p style="text-align: center;"><strong>Добавится аудит сервера</strong></p>\n<p style="text-align: center;"><strong></strong></p>\n<h2 style="text-align: center;"><span style="color: #ff0000;"><strong>Бот находится в бета тесте!</strong></span></h2>\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>По поводу багов сообщайте командой bug</strong></span></p>\n<p style="text-align: center;"><span style="color: #ff0000;"><strong>Спасибо!</strong></span></p>','\n',char(10)),'"ZSR7qHfHVs"',NULL,'"https://discord.com/oauth2/authorize?client_id=773555742758273025&scope=bot&permissions=2147483647"','["moderation","fun","economy","meme"]',1,1,1,'430785563755413504','1605807957651','1605809061348','2','0',0,'2020-11-19 17:45:57.652 +00:00','2020-11-21 19:01:22.767 +00:00');
INSERT INTO Bots VALUES(66,'758675335037321268','e!','670971997043425292','Пишет рандомный бред)) (работает НЕ по цепям Маркова!)',replace('ErundenBot это бот который отправляет рандомный бред!\nТак же у бота часто проходят обновления! \nЕсли бот отправил смешную фразу или вы заметили баг то пишите на наш сервер!\nТак же вы можете туда присылать свои фразы и мы их обязательно добавим!','\n',char(10)),'"a7DppJxKtw"',NULL,'"https://discordapp.com/oauth2/authorize?client_id=758675335037321268&scope=bot&permissions=7168"','["fun"]',1,1,1,'430785563755413504','1605878775971','1605879056087','2','0',0,'2020-11-20 13:26:15.973 +00:00','2020-11-25 08:16:14.252 +00:00');
INSERT INTO Bots VALUES(71,'727788356787896371','!','465853102914928640','Бот, созданный для вас с ❤','<div class="update"> Обновление 0.6 <br> Лог обновления на сервере поддержки в канале новостей </div> <br><div class="warn"> На данный момент бот имеет ограничение в 100 серверов!</div><br><strong>Функционал</strong><br><div class="f">● Кастомный префикс</div><div class="f">● Система приватных голосовых каналов</div><div class="f">● Различные фан-команды и реакции</div><div class="f">● Экономика</div><div class="f">● Мини-игры: страна по флагу</div><div class="f">● Утилиты, по типу say, serverinfo</div><div class="f">● Уникальная система серверных токенов <b>(в разработке)</b></div><br><b>Внимание!</b><br>Если у вас возникла проблема с ботом/вы хотите сообщить о баге - напишите команду !bug <сообщение> у себя на сервере и мы постараемся как можно быстрее решить эту проблему.<style> .warn{color: white; border: 2px solid rgb(255, 0, 0); background-color: darkred; display: inline-block; margin: 0 auto; padding: 5px; border-radius: 10px;} .update{color: white; border: 2px solid rgb(0, 255, 0); background: darkgreen; display: inline-block; margin: 0 auto; padding: 5px; border-radius: 10px;} .t {background: linear-gradient(to right, #add8e6, #8A2BE2);} .toast {background: #8A2BE2;} .comment posted {background-color: #121212;} .botPage{background-color: #121212;} .dropMenuSpan {background: #000000} .user {background: #000000} .col-md-12 {background: #000000} .botUpBtn{background: #8A2BE2;} .botSupportRight{background: #8A2BE2;} .btn {background: #8A2BE2;} .botSupportLeft{background: #8A2BE2;} .col-sm-8{text-align:center;}body{width: 100%;height: 100%;background: #000000;}.f{transition:all .1s ease;padding:5px;margin:3px 0;border-radius:4px;font-size:18px} .f:hover{transform:scale(1.05);box-shadow:0 0 15px rgba(0,0,0,.3);background-color:#141518}.f</style>','"2PTmGWb"',NULL,'"https://discord.com/oauth2/authorize?client_id=727788356787896371&scope=bot&permissions=8"','["fun","economy","utility"]',1,1,1,'534794173258137620','1606041161397','1606041367168','1','0',0,'2020-11-22 10:32:41.398 +00:00','2020-11-22 11:19:59.509 +00:00');
INSERT INTO Bots VALUES(73,'768902012115877900','!','326369659832107010','Горячий бот с полезыми функциями 🔥',replace('<span style="color:#EF3628"><span style="font-size:36px"><span style="font-family:Comic Sans MS,cursive">Frime</span></span></span>\n\n<span style="color:#FCFEFC"><span style="font-size:17px"><span style="font-family:Comic Sans MS,cursive">Здравствуйте, меня зовут Денис и я начинающий разработчик ботов.</span></span></span>\n\n<span style="color:#34E8EA"><span style="font-size:36px"><span style="font-family:Comic Sans MS,cursive">Система</span></span></span>\n\n<span style="color:#FCFEFC"><span style="font-size:17px"><span style="font-family:Comic Sans MS,cursive"> Имеет команды : \n  \n**•** Модерации (бан, кик, опрос, очистить и так далее),\n  \n**•** Прочее (Шар, IQ, аватар, обработка фото и так далее)\n  \n**•** Стандартные (bot, информация о пользователе, информация о сервере и так далее.\n\n**•** РП команды (Плюнуть, обнять и так далее)\n\n**-** Если вы нашли баг - сообщите нам введя команду "!bug текст"</span></span></span>','\n',char(10)),'"3TRw4dq"',NULL,'"https://discord.com/api/oauth2/authorize?client_id=768902012115877900&permissions=8&scope=bot"','["moderation","utility"]',1,1,1,'534794173258137620','1606048385102','1606048937902','2','0',0,'2020-11-22 12:33:05.104 +00:00','2020-11-22 17:00:00.326 +00:00');
INSERT INTO Bots VALUES(76,'591595831258251264','n.','289418396867624960','Привет, капитан, меня зовут Narmaya🦋.',replace('> `(∪｡∪)｡｡｡zzZ`\n> `٩(ˊ〇ˋ*)و` Фваах... Куу... Фваа?!\n> Здравствуйте, капитан! Нет, я не спала сейчас!\n> Что?! Капитан, хотите узнать обо мне побольше? Я так счастлива! `(〃 ＾ ▽ ＾ 〃)`\n\n#### Начнем с того, что меня зовут **_Narmaya_** (Время запомнить `( ͠° ͟ʖ ͡°)`).\n\n#### Я могу развлечь тебя в трудные времена:\n\n - Перевод текста на красивый, объемный ASCII текст, просто скажите мне `n.ascii ваш текст здесь`.\n - Если вы скажете мне `n.delete @user`, то я сброшу шуточное уведомление об удалении упомянутого пользователя.\n - Если мы вдвоем сможем поиграть в камень-ножницы-бумаги, скажите `n.rps`, когда будете готовы проиграть `(¬¬‿¬)`.\n\n#### Я также могу рассказать вам и показать другую информацию:\n\n - Вот табличка с `n.help`, простой карточный список информации, если вы хотите узнать больше, просто укажите, что вы хотите, я вам помогу `(o･ω･o)`.\n - Скажи "сыр", ты на камере! Скажите `n.avatar @user` и я покажу вам фотографию вас или упомянутого пользователя.\n - Ненавижу `n.botinfo` он показывает почти всю информацию обо мне `(Ò﹏Ó)`.\n - С помощью `n.ping` я должна ответить как можно быстрее `(◎ ◎)ゞ`.\n - Капитан хочет знать погоду на сегодня? Я могу сказать тебе, просто спроси меня `n.weather город`.\n\n#### Я могу быть плохой с непослушными пользователями:\n\n - Скажите мне, кто тут непослушный с `n.kick @user` и я вышвырну непослушного пользователя прочь `|･ω･)`.\n - Удалить несколько сообщений? Это легко с `n.prune значение`.\n - Капитан, я говорю с вами на непонятном языке? Спросите меня `n.language язык`, чтобы я могла говорить на понятном вам языке `ヾ(*''▽''*)`\n\n#### Знаешь, почему я тебе не надоедаю? Да! При моем участии у вас будет музыкальный аккомпанемент `( ˘ ɜ˘) ♬♪♫`:\n\n - Что нужно, чтобы играть отличную музыку? Просто скажи "Эй, Нармая, включи `n.play название`".\n - Вот `n.queue` это необходимо для того, чтобы выяснить, какие песни находятся в очереди.\n - ~~Но с помощью `n.search запрос` вы можете найти подходящую песню.~~\n - Попросите меня `n.skip` чтобы пропустить песню, если она вам не нравится.\n - Громче? Тише? Скажите мне, как громко я буду `n.volume значение`.\n - `n.bassboost значение` Делает много звуков бум-бума `Σ(°ロ°)`\n - Скажи `n.pause` и я буду ждать, я буду молчать здесь `(￢ ￢)``.\n - И если ты скажешь `n.stop`, я полностью заткнусь `( ╥ω╥)`\n\n> Со временем я буду учиться и узнавать все больше и больше, чтобы угодить вам.\n> Просто подождите до этого момента, Капитан! `〜〜(／￣▽)／ 〜ф`\n\n> Кстати, я не забыла сказать: "Я знаю несколько языков, так что ты не заблудишься!"? Ну, я просто напомню тебе `(⌒‿⌒)`\n\n## Капитан, я буду очень рад, если вы пригласите меня на свою вечеринку! `("ಡωಡ")`\n\n*Кстати, если у вас есть вопросы, просто свяжитесь с моим лучшим другом. *nearintellectual fox#6595*, он вам поможет.*','\n',char(10)),NULL,NULL,'"https://discord.com/api/oauth2/authorize?client_id=591595831258251264&permissions=8&scope=bot"','["moderation","fun","anime","music"]',1,1,1,'430785563755413504','1606244374246','1606244827461','1','0',0,'2020-11-24 18:59:34.248 +00:00','2020-11-24 19:27:37.567 +00:00');
INSERT INTO Bots VALUES(78,'763338880916652042','!','743244761963561032','Бот Ocean-то что вы искали',replace('<h3>\n<span style="color:#00FFFF"><span style="font-size:36px"><span style="font-family:Comic Sans MS,cursive">Ocean</span></span></span>\n</h3>\n<p>\n<span style="font-size:16px"><span style="font-family:Comic \n<span style="font-family:Comic Sans MS,cursive">\nПрефикс бота изначально ! ,чтобы узнать список комманд пропишите !help,в боте больше развит фан и ролеплей нежели\nчто-то другое!Над ботом идёт работа(сейчас делаеться вклад в модерацию),если нужна будет помощь есть сервер поддержки! \nВ боте довольно много функций которые помогут вам с сервером! ,&nbsp;</span>\n</p>\n<h4>\n<span style="color:#00FFFF"><span style="font-size:36px"><span style="font-family:Comic Sans MS,cursive">Функции бота!</span></span></span>\n</h4>\n<p><span style="font-size:18px"><span style="font-family:Comic Sans MS,cursive"><strong>•</strong> Основные команды &nbsp;)</span><br>\n<span style="font-family:Comic Sans MS,cursive"><strong>•</strong>&nbsp;Модерация на довольно хорошем уровне🛠 (бан, кик, очистка сообщений, репорт и др.)</span><br>\n<strong><span style="font-family:Comic Sans MS,cursive">•</span></strong> <span style="font-family:Comic Sans MS,cursive">Развлечения и фан комманды( монетка, мемы, игра "камень ножницы бумага", kiss, kill и другие)<br>\n<strong>•</strong>Утильты!</span><br>\n&nbsp;</span></p>\n\n<div class="warn">\nЕсли вдруг вы нашли ошибку/баг и так далее в нашем боте ,то пропишите команду !bug [текст] ,желательно подробно\n\n  <br>\n</div>\n<style>\n  .warns {\n    colors: white;\n border: 2px solid rgb(255, 255, 6);\n    background-colors: brown;\n    display: inline-block;\n       margin: 0 auto;\n    padding: 5px;\n    border-radius: 10px;\n\n\n  }\n</style>\n<style> .botPage {background-color: #191970;} </style>\n<style> .botPageInvite {background: linear-gradient(to right,#87CEEB , #87CEEB);} .botPage {background-color: #191970;} .botUpBtn{background: linear-gradient(to right, #191970,#191970);}</style>','\n',char(10)),'"zFAhnqk"',NULL,'" https://discord.com/oauth2/authorize?client_id=763338880916652042&scope=bot&permissions=2146958847"','["moderation","fun","utility","meme"]',1,1,1,'374155911478116352','1606296141591','1606296360444','0','0',0,'2020-11-25 09:22:21.591 +00:00','2020-11-25 09:26:00.444 +00:00');
INSERT INTO Bots VALUES(79,'575380644939563032','!','374155911478116352','Начинающий бот для вашего сервера.',replace('<style>\n#botPrefixCopy:hover {\n  background-color: #7289da;\n}\n.f{transition:all .1s ease;padding:10px;margin:3px 0;border-radius:4px;font-size:20px}.f:hover{transform:scale(1.05);box-shadow:0 0 25px rgba(0,0,0,.3);background-color:#141518}.f p{font-size:14px}body{background:#212121}#topLine,.botPage{background:#121212}.botPageImg{border:4px solid #212121;-webkit-box-shadow:10px 10px 11px -2px rgba(0,0,0,.75);-moz-box-shadow:10px 10px 11px -2px rgba(0,0,0,.75);box-shadow:10px 10px 11px -2px rgba(0,0,0,.75)}.user{background:#121212}</style>\n<h1 style="text-shadow: 0 0 5px#fff, 0 0 20px #fff, 0 0 13px #e60073, 0 0 40px #e60073, 0 0 1px #e60073, 0 0 3px #e60073, 0 0 70px #e60073;text-align:center;font-size:30px;">Kalexi</h1>\n<div class="errorMsg" style = "\n    text-align: center;\n    background: #680b0b;\n    border-radius: 5px;\n    margin-top: 15px;\n    padding: 10px;\n    border: 2px solid #FA1A1A;\n">\nНа данный момент бот находится в стадии разработки, но его обновления стабильны.\n</div>\n<h1 style="text-align:center;font-size:25px">Возможности:</h1>\n<div class="f">\n• Авто выдача роли при заходе на сервер.<br></div>\n<div class="f">• Система экономики.<br></div>\n<div class="f">• Система ролей за уровень.<br></div>\n<div class="f">• Кастомные префиксы.<br></div>\n<div class="f">• Приват войсы.<br></div>\n<div class="f">• Логи удаленных и измененных сообщений.<br></div>\n<p>Что бы узнать список команд напишите !help<br>\n<strong>Спасибо Mrsasha45op#9797 за разрешения на стили.</strong></p>','\n',char(10)),'"skxCEaP"',NULL,'"https://discord.com/oauth2/authorize?client_id=575380644939563032&scope=bot&permissions=8"','["economy","leveling","utility"]',1,1,1,'374155911478116352','1606315444330','1606315466766','0','0',0,'2020-11-25 14:44:04.332 +00:00','2020-11-25 14:44:26.766 +00:00');
INSERT INTO Bots VALUES(80,'572285950034444298','.','776965894911426590','Комбайн бот с множеством функций.',replace('\nВозможности:\n• Просмотр статистики с сервера Vimeworld\n• Экономика\n• Утилиты. (Просмотр профиля с github,Проверка варнов в базе Nika)\n• Персональные голосовые каналы\n• Развлечения, которые улучшат ваше настроение 😉\n\nЧасто выходят крутые обновления, если у вас есть желание предложить идею чтобы что-то добавили в бота, то заходите на поддержки\nСпасибо Циферке за стили','\n',char(10)),'"GQGtFv2"',NULL,NULL,'["moderation","fun","economy","leveling"]',1,1,1,'534794173258137620','1606316415257','1606316754893','1','0',0,'2020-11-25 15:00:15.257 +00:00','2020-11-25 15:14:35.364 +00:00');
