INSERT INTO Bots VALUES(82,'740167054086111302','?','380014926472937473','Бот с интересными и полезными командами.',replace('# It''s Tylex!\n#### Преимущества\n  - Дизайн\n  - Множество различных команд\n  - Креативность\n  - Простота\n\n#### Функционал\n  - Фильтры и оверлеи для аватаров\n  - Игры\n  - Фото милых животных ^^\n  - Браки\n  - Модерация - `Ban`, `kick`, `mute`, `warn`, `add-role`, `remove-role`, `random-role`\n  - Чат-бот\n  - Команды-реакции - `wink`, `pat`, `hug`, `facepalm`\n  - Звуки [NEW]\n  - И другое...\n\n> Если что-то не работает или вы нашли ошибку, напишите это на сервере поддержки `?support` или уведомите нас командой `?bug <text>`.\n\n> Также, вы можете предложить идеи командой `?idea <text>`.','\n',char(10)),'"mscQYv6"',NULL,'"https://discordapp.com/oauth2/authorize?&client_id=740167054086111302&scope=bot&permissions=8"','["moderation","fun","utility","music"]',1,1,1,'534794173258137620','1606406530914','1606406755236','1','0',0,'2020-11-26 16:02:10.915 +00:00','2020-11-26 16:07:15.345 +00:00');
